import React from "react";
import styled from "styled-components";
import Link from "next/link";

const MyHeader = styled.nav``;

const Header = props => {
  return (
    <MyHeader>
      <ul>
        <li>World</li>
        <li>State</li>
      </ul>
    </MyHeader>
  );
};

export default Header;
